import './index.css';

const About = () => (
    <div className='aboutus'>
        <h2 id="heading">About Us</h2>
        <p id = "about-text">
        Umuhinzi platform empowers farmers by making them informed thus able to make better
        decisions.<br/> When purchasing farm inputs through this platform, you will access the latest prices
        for input products.<br/> You will also get news on what is happening in the tea sector.If 
        you do not  have a smartphone, no worries.<br/> We have USSD services for you where you will 
        get the same features.By dialing the provided code on your phone,you will access the services we have on the web app.
        </p>

    </div>
);

export default About;
